import React, { useState } from 'react';
import axios from 'axios';

function App() {

    const [data, setData] = useState(null);

    const onClick = () => {
      axios
       .get('/translator/test')
       .then((response) => {setData(response.data)
      });
    };
    return (
      <div>
        <div>
          <button onClick={onClick}>불러오기</button>
        </div>
        <div>
          <input type='word' placeholder='번역할 글자를 입력해주세요' id='word' value=''></input>  
        </div>

        {data && (
        <textarea
        rows={7}
        value={data.message.result.translatedText}
        readOnly={true}
        />
        )}
      </div>
    );
}

export default App;
